def get_b64(archivo, p):
	
	with open(archivo, 'rb') as f:
		text = f.read()
		text = base64.urlsafe_b64encode(text)
		f.close()
	
	c = cut_str(text.decode(), 0)
	
	with open('file.txt', 'w') as f:
		if is_list(c):
			f.write('{} = \''.format(p)+c.pop(0)+'\'+\\\n')
			u = c.pop()
			for _ in c: f.write('        \''+_+'\'+\\\n')
			f.write('        \''+u+'\'\n')
		else:
			f.write('{} = \''.format(p)+c+'\'\n')
		f.close()

